const SearchBook = () => (
    <form action="/" method="get">
        <input
            value={searchQuery}
            onInput={e => setSearchQuery(e.target.value)}
            type="text"
            id="header-search"
            placeholder="Search books"
            name="book"
        />
        <button type="submit">Search</button>
    </form>
);

export default SearchBook;
